-- ----------------------------
-- Table structure for tbl_employee
-- ----------------------------
DROP TABLE IF EXISTS `tbl_employee`;
CREATE TABLE `tbl_employee` (
  `id` varchar(36) NOT NULL COMMENT '',
  `name` varchar(255) NOT NULL COMMENT '',
  `sex` int(1) DEFAULT NULL COMMENT '',
  `birthday` datetime DEFAULT NULL COMMENT '',
  `nation` varchar(50) DEFAULT NULL COMMENT '',
  `nativeplace` varchar(255) DEFAULT NULL COMMENT '',
  `political` varchar(255) DEFAULT NULL COMMENT '',
  `marriage` varchar(2) DEFAULT NULL COMMENT '',
  `birthplace` varchar(255) DEFAULT NULL COMMENT '',
  `create_date_time` datetime DEFAULT NULL,
  `deleted` int(11) DEFAULT NULL,
  `update_date_time` datetime DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `PK_SystemNo` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

