INSERT INTO `tbl_item` VALUES ('402880e55c590053015c59291f6a0000', '2017-05-30 19:41:26', '0', '2017-05-30 19:47:54', '4', 'public class Solution006 {\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\n    \n         int len_1=nums1.length;\n        int len_2=nums2.length;\n        int middle=0;\n        boolean isOdd=false;\n        if((len_1+len_2)%2==0){\n            middle=(len_1+len_2)/2-1;\n            isOdd=false;\n        }else{\n            middle=(len_1+len_2)/2;\n            isOdd=true;\n        }\n        //\n        int[] num=new int[len_1+len_2];\n        int i=0,l=0,r=0;\n        while(l<len_1&&r<len_2){\n            if(nums1[l]<nums2[r]){\n                num[i]=nums1[l];\n                i++;\n                l++;\n            }else{\n                num[i]=nums2[r];\n                i++;\n                r++;\n            }\n        }\n        while(l<len_1){\n            num[i++]=nums1[l++];\n        }\n        while(r<len_2){\n            num[i++]=nums2[r++];\n        }\n\n        if(!isOdd){\n            return (double)(num[middle]+num[middle+1])/2;\n        }else{\n            return (double)num[middle];\n        }\n    }\n}', '', 'Solution006', '****\n\nThere are two sorted arrays nums1 and nums2 of size m and n respectively.\n\nFind the median of the two sorted arrays. The overall run time complexity should be O(log (m+n)).\n\n**Example 1:**\n```\nnums1 = [1, 3]\nnums2 = [2]\n\nThe median is 2.0\n```\n\n**Example 2:**\n```\nnums1 = [1, 2]\nnums2 = [3, 4]\n\nThe median is (2 + 3)/2 = 2.5\n```', '', null, '006', '1', 'findMedianSortedArrays', '1', '', '0', 'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      //do something;\r\n    }\r\n}', '', '2', '402880e55c590053015c592ee07d0006', 'leetcode', null, null);
INSERT INTO `tbl_item` VALUES ('402880e55c590053015c59732071000c', '2017-05-30 21:02:16', '0', '2017-05-30 21:02:16', '1', 'public class Solution007 {\n    public String longestPalindrome(String s) {\n        int max=0;\n        int j=0;\n        //\n        for(int i=0;i<s.length();i++){\n            char cur=s.charAt(i);\n            boolean flag=true;\n            int index=0;\n            while(flag){\n                if(i-index<0||i+index>=s.length()){\n                    flag=false;\n                    continue;\n                }\n                if(s.charAt(i-index)==s.charAt(i+index)){\n                    index++;\n                }else{\n                    flag=false;\n                }\n            }\n            if(index>max){\n                max=index;\n                j=i-index+1;\n            }\n        }\n\n        int odd=2*(max-1)+1;\n        //\n        max=0;\n        int k=0;\n        for(int i=0;i<s.length();i++){\n            char cur=s.charAt(i);\n            if(i>0){\n                boolean flag=true;\n                int index=0;\n                while(flag){\n                    if(i-index-1<0||i+index>=s.length()){\n                        flag=false;\n                        continue;\n                    }\n                    if(s.charAt(i-index-1)==s.charAt(i+index)){\n                        index++;\n                    }else{\n                        flag=false;\n                    }\n                }\n                if(index>max){\n                    max=index;\n                    k=i-index;\n                }\n            }\n            if(i+1<s.length()){\n                boolean flag=true;\n                int index=0;\n                while(flag){\n                    if(i-index<0||i+index+1>=s.length()){\n                        flag=false;\n                        continue;\n                    }\n                    if(s.charAt(i-index)==s.charAt(i+index+1)){\n                        index++;\n                    }else{\n                        flag=false;\n                    }\n                }\n                if(index>max){\n                    max=index;\n                    k=i-index+1;\n                }\n            }\n        }\n        int even=2*max;\n        if(odd>even){\n            return s.substring(j,odd+j);\n        }else{\n            return s.substring(k,even+k);\n        }\n        \n    }\n}', '', 'Solution007', '****\n\nGiven a string s, find the longest palindromic substring in s. You may assume that the maximum length of s is 1000.\n\n**Example 1**\n```\nInput: \"babad\"\n\nOutput: \"bab\"\n\nNote: \"aba\" is also a valid answer.\n```\n\n**Example 2**\n```\nInput: \"cbbd\"\n\nOutput: \"bb\"\n```', '', null, '007', '1', 'longestPalindrome', '0', '', '0', 'public class Solution007 {\r\n   public String longestPalindrome(String s) \r\n      //write your code;\r\n    }\r\n}', '', '1', '402880e55c590053015c597305c2000b', 'leetcode', null, null);
INSERT INTO `tbl_item` VALUES ('402880e55c597d0c015c59a856730000', '2017-05-30 22:00:23', '0', '2017-05-31 08:50:09', '9', '/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode head=null;\n        ListNode current=null;\n        \n        ListNode nextNode=l1;\n        int pre=0;\n        while(nextNode!=null){\n            if(head==null){\n               head=new ListNode((l1.val+l2.val)%10+pre);\n               current=head;\n            }\n            else{\n                ListNode node=new ListNode((l1.val+l2.val)%10+pre);\n                current.next=node;\n                current=node;\n            }\n            if(current.val>=10) {\n                pre=current.val/10;\n                current.val=current.val%10;\n            }else {\n                pre = (l1.val + l2.val) / 10;\n            }\n            l1=l1.next;\n            l2=l2.next;\n            if(l1==null&&l2!=null){\n               nextNode=l2;\n               l1=new ListNode(0);\n            }\n            if(l2==null&&l1!=null){\n                nextNode=l1;\n                l2=new ListNode(0);\n            }\n            if(l1==null&&l2==null){\n                nextNode=null;\n            }\n        }\n        if(pre>0){\n            current.next=new ListNode(pre);\n        }\n       return head;\n    }\n}', 'public class ListNode {\n     int val;\n     ListNode next;\n     ListNode(int x) { val = x; }\n}', 'Solution008', '****\n\nYou are given two non-empty linked lists representing two non-negative integers. The digits are stored in reverse order and each of their nodes contain a single digit. Add the two numbers and return it as a linked list.\n\nYou may assume the two numbers do not contain any leading zero, except the number 0 itself.\n\n**Input**\n```\n(2 -> 4 -> 3) + (5 -> 6 -> 4)\n```\n\n**Output**\n```\n7 -> 0 -> 8\n```', '', null, '008', '3', 'addTwoNumbers', '1', '', '1', '/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        \n    }\n}', '', '5', '8a8a82695c5bf692015c5bfb26fd0003', 'leetcode', null, null);
