INSERT INTO `tbl_item` VALUES ('402881925c3fa5c4015c3ff0bd470001', '2017-05-25 22:09:20', '0', '2017-05-27 17:38:29', '32', 'public class TwoSum {\n      public int[] main(int[] nums, int target) {\n        int[] ret=new int[2];\n        boolean flag=false;\n        for(int i=0;i<nums.length;i++){\n             int a=nums[i];\n            for(int j=i+1;j<nums.length;j++){\n               if(target-a==nums[j]){\n                   ret[0]=i;\n                   ret[1]=j;\n                   flag=true;\n                   break;\n               }\n            }\n            if(flag)\n               break;\n        }\n        return ret;\n    }\n}', '', 'TwoSum', 'Given an array of integers, return indices of the two numbers such that they add up to a specific target.\n\nYou may assume that each input would have exactly one solution, and you may not use the same element twice.\n\n**Example**\n```\nGiven nums = [2, 7, 11, 15], target = 9,\n\nBecause nums[0] + nums[1] = 2 + 7 = 9,\nreturn [0, 1].\n```', '', null, '004', '1', 'main', '1', '', '25', 'public class TwoSum {\r\n    public int[] main(int[] nums,int target) {\r\n      //do something;\r\n    }\r\n}', 'leetcode-', '26', '402881925c3fa5c4015c3fef43da0000', 'leetcode', null, null);
INSERT INTO `tbl_item` VALUES ('402881925c4986bd015c499d23ad0007', '2017-05-27 19:14:14', '0', '2017-05-28 09:08:02', '18', 'import java.util.HashMap;\nimport java.util.Map;\n\n/**\n * Created by billJiang on 2017/5/27.\n * e-mail:475572229@qq.com  qq:475572229\n */\npublic class Solution005 {\n    public int lengthOfLongestSubstring(String s) {\n        Map<Character, Integer> map = new HashMap<>();\n        int max = 0;\n        int start = 0;\n        for (int i = 0; i < s.length(); i++) {\n            if (map.containsKey(s.charAt(i))) {\n                start=Math.max(map.get(s.charAt(i))+1,start);\n                if (i - start+1 > max) {\n                    max = i - start+1;\n                }\n\n            }else{\n                if(i-start+1>max)\n                    max=i-start+1;\n            }\n\n            map.put(s.charAt(i), i);\n        }\n        return max;\n    }\n}', '', 'Solution005', 'Given a string, find the length of the longest substring without repeating characters.\n\n**Examples:**\n\nGiven `\"abcabcbb\"`, the answer is `\"abc\"`, which the length is 3.\n\nGiven `\"bbbbb\"`, the answer is `\"b\"`, with the length of 1.\n\nGiven `\"pwwkew\"`, the answer is `\"wke\"`, with the length of 3.\nNote that the answer must be a substring,` \"pwke\"` is a subsequence and not a substring.\n\n', '', null, '005', '3', 'lengthOfLongestSubstring', '1', '', '1', 'public class Solution005 {\r\n        public int lengthOfLongestSubstring(String s){\r\n      //do something;\r\n    }\r\n}', '', '6', '', 'leetCode', null, null);
