INSERT INTO `tbl_markdown` VALUES ('402880e958ecdff60158ed0c62ba0001', '2016-12-11 16:42:41', '0', '2017-02-06 11:18:28', '2', 'Markdown,', 'Markdown', null, '# Markdown\n\nMarkdown**Editor.md**\n\n- **MarkdownMarkdown**\n- ****\n- ****\n- ***LaTex***\n- **UML**\n- ****\n- **Markdown**\n- ****\n-------------------\n\n## \n\n -      `Ctrl + B`\n -      `Ctrl + I`\n -      `Ctrl + Q`\n -     `Ctrl + L`\n -     `Ctrl + K`\n -     `Ctrl + G`\n -     `Ctrl + H`\n -     `Ctrl + O`\n -     `Ctrl + U`\n -     `Ctrl + R`\n -     `Ctrl + Z`\n -     `Ctrl + Y`\n\n## Markdown\n\n> Markdown HTML     <a href=\"https://zh.wikipedia.org/wiki/Markdown\" target=\"_blank\"> [  ]\n\n******[](http://www.csdn.net)\n\n **Markdown Extra** , [Github][2].\n\n### \n\n**MarkdownExtra**\n\n     | \n-------- | ---\nComputer | $1600\nPhone    | $12\nPipe     | $1\n\n\n\n|       |     |   |\n| :-------- | --------:| :--: |\n| Computer  | 1600  |  5   |\n| Phone     |   12  |  12  |\n| Pipe      |    1  | 234  |\n\n\n### \nmarkdown\n``` python\n@requires_authorization\ndef somefunc(param1=\'\', param2=0):\n    \'\'\'A docstring\'\'\'\n    if param1 > param2: # interesting\n        print \'Greater\'\n    return (param2 - param1 + 1) or None\nclass SomeClass:\n    pass\n>>> message = \'\'\'interpreter\n... prompt\'\'\'\n```\n\n\n### \n `[TOC]`\n\n[TOC]\n\n### \nMathJax*LaTex* [math.stackexchange.com][1].\n\n - $\\Gamma(n) = (n-1)!\\quad\\forall n\\in\\mathbb N$\n - \n\n$$	x = \\dfrac{-b \\pm \\sqrt{b^2 - 4ac}}{2a} $$\n\nLaTex [][3].\n\n### UML :\n\n\n\n```sequence\n->: , ?\nNote right of : \n-->: \n```\n\n\n\n```flow\nst=>start: \ne=>end: \nop=>operation: \ncond=>condition: \n\nst->op->cond\ncond(yes)->e\ncond(no)->op\n```\n\n-  ****  [][4],\n-  ****  [][5].\n\n## \n\n[write.blog.csdn.net/mdeditor](http://write.blog.csdn.net/mdeditor)**Markdown**\n\n\n\n\n\n <i class=\"icon-disk\"></i> \n\n> ********', null, null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('402880ea5aae3edf015ab22e20740018', '2017-03-09 16:27:31', '0', '2017-03-09 17:29:53', '2', 'BaseFile,Bootstrap-fileinput,', 'BaseFile', '402880e456223e8f015625231d8e0003', '##\nBaseFileAdminEAPBootstrap-fileinput BaseFile\n\n- \n- \n- \n- \n\nBaseFile[Bootstrap-fileinput ](blog.csdn.net/jrn1012/article/details/60963714)\nBootstrap-fileinputAPI[http://plugins.krajee.com/file-input](http://plugins.krajee.com/file-input)\n\n##\n###1\ncssjs\n- css\n```\n<link rel=\"stylesheet\" href=\"./resources/common/libs/fileinput/css/fileinput.min.css\">\n```\n- js\n```\n<script src=\"./resources/common/libs/fileinput/js/fileinput.js\"></script>\n<script src=\"./resources/common/libs/fileinput/js/locales/zh.js\"></script>\n<!--BaseFile-->\n<script src=\"./resources/common/js/base-file.js\"></script>\n```\nform`enctype=\"multipart/form-data\"`\n\n###2\n\nBaseFiletype=file\n- html\n```\n          <input type=\"hidden\" name=\"fileIds\" id=\"fileIds\">\n          <div class=\"form-group\">\n                <div class=\"btn btn-default btn-file\" id=\"uploadFile\">\n                    <i class=\"fa fa-paperclip\"></i> (Max. 10MB)\n                </div>\n            </div>\n            <div class=\"form-group\" id=\"file_container\">\n                <input type=\"file\" name=\"file\"  id=\"attachment\">\n            </div>    \n```\n- js\n```javascript\n$(\"#uploadFile\").file({\n            title: \"\",\n            fileinput: {\n                maxFileSize: 10240,\n                maxFileCount:3\n            },\n            fileIdContainer:\"[name=\'fileIds\']\",\n            showContainer:\'#attachment\',\n            // edit=  detail= \n            showType:\'edit\',\n            // (window:false)\n			window:true,\n            callback:function(fileIds,oldfileIds){\n                //fileIds\n                this.showFiles({\n                    fileIds:fileIds\n                });\n            }\n        });\n```\n###3\n\n\n- html\n```html\n<div class=\"form-group\" id=\"file_container\">\n      <input type=\"file\" name=\"file\"  id=\"attachment\">\n</div>\n```\n- js\n```javascript\n    $(\"#attachment\").file({\n            fileinput: {\n                maxFileSize: 10240,\n                maxFileCount:3\n            },\n            fileIdContainer:\"[name=\'fileIds\']\",\n            window:false\n        });\n```\n###4\n- `window` true,\n\n- `title` window=true\n\n- `width` window=true900\n\n- `winId` window=trueidfileWin\n\n- `fileinput` Bootstrap-fileinput`allowedFileTypes``maxFileSize``maxFileCount`Bootstrap-fileinputAPI\n\n- `fileIdContainer` idid\n\n- `showContainer` window=truewindow=falsebase-file\n\n- `showType` window=true`edit``detail`,`edit``detail`\n\n- `callback` window=true`fileIds`,`oldfileIds`idsids\n\n- BaseFileBaseFileBaseFile\n```javascript\nBaseFile.prototype.default = {\n        winId: \"fileWin\",\n        width: 900,\n        title: \"\",\n        //\n        url: basePath + \"/file/uploader\",\n        //\n        multiple: true,\n        //\n        window:true,\n        showType:\"detail\",\n        fileinput: {\n            language: \'zh\',\n            uploadUrl: basePath + \"/file/uploadMultipleFile\",\n            deleteUrl:basePath+\"/file/delete\",\n            uploadAsync:false,\n            validateInitialCount:true,\n            overwriteInitial: false,\n            allowedPreviewTypes: [\'image\'],\n            previewFileIcon:\'<i class=\"fa fa-file-o\"></i>\',\n            previewFileIconSettings: null,\n            slugCallback: function (text) {\n                var newtext=(!text||text==\'\') ? \'\' : String(text).replace(/[\\-\\[\\]\\/\\{}:;#%=\\(\\)\\*\\+\\?\\\\\\^\\$\\|<>&\"\']/g, \'_\');\n                //\n                return newtext.replace(/(^\\s+)|(\\s+$)/g,\"\").replace(/\\s/g,\"\");\n            }\n        }\n    }\n```\n\n', 'file', null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('402880ed5abdfec1015abe20b0e90000', '2017-03-12 00:08:17', '0', '2017-03-12 00:08:17', '0', 'BaseFile,Bootstrap-fileinput,,', 'BaseFile-', '402880e456223e8f015625231d8e0003', '##\nBootstrap-fileinputBaseFileBootstrap-fileinputotherActionButtons\n\n![](http://img.blog.csdn.net/20170311234606744?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n##\n\n###1fileinput.js\nfileinput.min.js\n![fileinput.js](http://img.blog.csdn.net/20170311235027047?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n###2\nBaseFileotherActionButtons\n![](http://img.blog.csdn.net/20170311235325208?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n```\notherActionButtons:\'<button type=\"button\" class=\"kv-file-down btn btn-xs btn-default\" {dataKey} title=\"\"><i class=\"fa fa-cloud-download\"></i></button>\',\n```\n###3\nclick\n![](http://img.blog.csdn.net/20170311235701260?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n\n\n```javascript\n   BaseFile.prototype.showFiles=function(options){\n        //\n        //console.log(\"config==========\"+JSON.stringify(config));\n        fileComponet.fileinput(\'destroy\');\n        fileComponet.fileinput(config).on(\"filedeleted\",function (event,key) {\n            var newfids=self.deleteFileIds(key,self.options.fileIds);\n            self.options.fileIds=newfids;\n            self.updateFileIds();\n        }).on(\"fileuploaded\",function(event,data,previewId,index){\n            var newfids=self.addFileIds(data.response.fileIds,self.options.fileIds);\n            self.options.fileIds=newfids;\n            self.updateFileIds();\n            //otherActionButtons \n            self.downloadHandler(this);\n        }).on(\"filebatchuploadsuccess\",function (event,data,previewId,index) {\n            var newfids=self.addFileIds(data.response.fileIds,self.options.fileIds);\n            self.options.fileIds=newfids;\n            self.updateFileIds();\n            //otherActionButtons\n            self.downloadHandler(this);\n        }).on(\"filezoomhidden\", function(event, params) {\n            $(document.body).removeClass(\'modal-open\');\n            $(document.body).css(\"padding-right\",\"0px\");\n        })\n        this.downloadHandler(fileComponet);\n    }\n\n\n    /**\n     * \n     */\n    BaseFile.prototype.downloadHandler=function(fileobj){\n        if(!fileobj)\n            fileobj=$(this.options.showContainer);\n        var objs=$(fileobj).data(\'fileinput\').$preview.find(\".kv-preview-thumb .kv-file-down\");\n        objs.unbind(\"click\");\n        objs.on(\"click\",function(){\n           //\n            window.location.href=basePath+\"/file/download/\"+$(this).data(\"key\");\n        });\n    }\n```\nfile_uploader.html\n\n###4\n\n```java\n  @RequestMapping(value=\"/download/{id}\",method = RequestMethod.GET)\n    public void downloadFile(@PathVariable(\"id\") String id,HttpServletRequest request,HttpServletResponse response) throws IOException {\n        SysFile sysfile = uploaderService.get(SysFile.class, id);\n\n        InputStream is = null;\n        OutputStream os = null;\n        File file = null;\n        try {\n            // PrintWriter out = response.getWriter();\n            if (sysfile != null)\n                file = new File(request.getRealPath(\"/\")+sysfile.getFilePath());\n            if (file != null && file.exists() && file.isFile()) {\n                long filelength = file.length();\n                is = new FileInputStream(file);\n                // \n                os = response.getOutputStream();\n                response.setContentType(\"application/x-msdownload\");\n                response.setContentLength((int) filelength);\n                response.addHeader(\"Content-Disposition\", \"attachment; filename=\\\"\" + new String(sysfile.getFileName().getBytes(\"GBK\"),// GBK\n                        \"iso8859-1\") + \"\\\"\");\n\n                // \n                byte[] b = new byte[4096];\n                int len;\n                while ((len = is.read(b)) > 0) {\n                    os.write(b, 0, len);\n                }\n            } else {\n                response.getWriter().println(\"<script>\");\n                response.getWriter().println(\" modals.info(\'!\');\");\n                response.getWriter().println(\"</script>\");\n            }\n\n        } catch (IOException e) {\n            // e.printStackTrace();\n        } finally {\n            if (is != null) {\n                is.close();\n            }\n            if (os != null) {\n                os.close();\n            }\n        }\n    }\n```\n\n', null, null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('402881935a5f60d3015a5f7d43900000', '2017-02-21 15:05:29', '0', '2017-02-21 15:08:45', '1', ',AdminEAP,AdminLTE,freemarker', '', '402880e456223e8f015625231d8e0003', 'AdminEAPAdminLTECURDdemoGithub\n\n**Github** : https://github.com/bill1012/AdminEAP\n\n**AdminEAP **: http://www.admineap.com\n\nfreemarkerAdminEAPCURD\n\n![](http://img.blog.csdn.net/20170221133333679?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n#\n\nGenerator\n\n##1\n\nHeader\n\n![](http://img.blog.csdn.net/20170221142700625?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nHeaderManyToOnejoinClassdataSourceurl\n\n##2xml\n\nqueryIdxmlxml\n\n![xml](http://img.blog.csdn.net/20170221144007125?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nAdminEAPxmlsqlhql\n\n##3xml\n\nxmlxmlxml\n\n![xml](http://img.blog.csdn.net/20170221144603370?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n##4\n\nqueryIdxml\n\n![](http://img.blog.csdn.net/20170221145011918?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n\n\n##5freemarker\n\nfreemarker\n\ncontroller.html\n```\npackage ${nameSpace}.controller;\n\nimport java.util.Date;\n\nimport javax.annotation.Resource;\nimport javax.servlet.http.HttpServletRequest;\n\nimport com.alibaba.fastjson.JSON;\nimport com.cnpc.framework.base.entity.Dict;\nimport com.cnpc.framework.utils.StrUtil;\nimport org.springframework.beans.BeanUtils;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.annotation.PathVariable;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestMethod;\nimport org.springframework.web.bind.annotation.ResponseBody;\n\nimport com.cnpc.framework.base.service.BaseService;\nimport com.cnpc.framework.annotation.RefreshCSRFToken;\nimport com.cnpc.framework.annotation.VerifyCSRFToken;\nimport com.cnpc.framework.base.pojo.Result;\nimport ${className};\n\n/**\n* ${modelName}\n* @author jrn\n* ${curTime?string(\"yyyy-MM-dd HH:mm:ss\")}\n*/\n@Controller\n@RequestMapping(\"/${htmlPrefix}\")\npublic class ${javaPrefix}Controller {\n\n    @Resource\n    <#if javaTypes?contains(\"service\")>\n    private ${javaPrefix}Service ${htmlPrefix}Service;\n    <#else>\n    private BaseService baseService;\n    </#if>\n\n    @RequestMapping(value=\"/list\",method = RequestMethod.GET)\n    public String list(){\n        return \"${businessPackage}/${htmlPrefix}_list\";\n    }\n\n    @RefreshCSRFToken\n    @RequestMapping(value=\"/edit\",method = RequestMethod.GET)\n    public String edit(String id,HttpServletRequest request){\n        request.setAttribute(\"id\", id);\n        return \"${businessPackage}/${htmlPrefix}_edit\";\n    }\n\n    @RequestMapping(value=\"/detail\",method = RequestMethod.GET)\n    public String detail(String id,HttpServletRequest request){\n        request.setAttribute(\"id\", id);\n        return \"${businessPackage}/${htmlPrefix}_detail\";\n    }\n\n    @RequestMapping(value=\"/get/{id}\",method = RequestMethod.POST)\n    @ResponseBody\n    public ${javaPrefix} get(@PathVariable(\"id\") String id){\n        return <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.get(${javaPrefix}.class, id);\n    }\n\n    @VerifyCSRFToken\n    @RequestMapping(value=\"/save\")\n    @ResponseBody\n    <#assign isObj=1>\n    <#list fields as field>\n        <#if field.columnName?contains(\".\")>\n            <#assign isObj=0>\n        </#if>\n    </#list>\n    public Result save(<#if isObj=1>${javaPrefix} ${htmlPrefix}<#else>String obj</#if>){\n        <#if isObj=0>\n        ${javaPrefix} ${htmlPrefix}= JSON.parseObject(obj,${javaPrefix}.class);\n        <#list fields as field>\n        <#if field.columnName?contains(\".\")>\n            <#assign fieldName=field.columnName?substring(0,field.columnName?index_of(\".\"))>\n            <#assign fieldN=fieldName?substring(0,1)?upper_case+fieldName?substring(1)>\n        ${htmlPrefix}.set${fieldN}(<#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.get(${field.type}.class,${htmlPrefix}.get${fieldN}().getId()));\n        </#if>\n        </#list>\n        </#if>\n        if(StrUtil.isEmpty(${htmlPrefix}.getId())){\n        <#if dateFields?exists&&(dateFields?size>0)>\n            <#list dateFields as date>\n            ${date};\n            </#list>\n        </#if>\n            <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.save(${htmlPrefix});\n        }\n        else{\n        <#if leftFields?exists&&(leftFields?size>0)>\n            ${javaPrefix} ${htmlPrefix}_old=<#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.get(${javaPrefix}.class,${htmlPrefix}.getId());\n            BeanUtils.copyProperties(${htmlPrefix},${htmlPrefix}_old, <#list leftFields as str><#if str_index==0>\"${str}\"<#else>,\"${str}\"</#if></#list>);\n            <#if leftDates?exists&&(leftDates?size>0)>\n                <#list leftDates as ld>\n             ${ld};\n                </#list>\n            </#if>\n            ${htmlPrefix}_old.setUpdateDateTime(new Date());\n            <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.update(${htmlPrefix}_old);\n            <#else>\n            ${htmlPrefix}.setUpdateDateTime(new Date());\n            <#if javaTypes?contains(\"service\")>${htmlPrefix}Service<#else>baseService</#if>.update(${htmlPrefix});\n            </#if>\n        }\n        return new Result(true);\n    }\n    \n    @RequestMapping(value=\"/delete/{id}\",method = RequestMethod.POST)\n    @ResponseBody\n    public Result delete(@PathVariable(\"id\") String id){\n        ${javaPrefix} ${htmlPrefix}=this.get(id);\n        try{\n            baseService.delete(${htmlPrefix});\n            return new Result();\n        }\n        catch(Exception e){\n            return new Result(false,\"\");\n        }\n    }\n\n}\n\n```\n\n##6\n\n\n\n![-](http://img.blog.csdn.net/20170221145826165?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n![-](http://img.blog.csdn.net/20170221145859391?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nCURD\n\n##7\n\nxml\n\nAdminEAP[AdminEAP](http://www.admineap.com)\n\n\n', 'code', null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('8a8a81425a118296015a118d0fda0000', '2017-02-06 11:52:21', '0', '2017-05-24 10:23:51', '4', 'Bootstrap modal,', 'Modals', '402880e456223e8f015625231d8e0003', '##\nAdminEAPBootstrap modal\n- info()\n- correct()\n- warn()\n- error()\n- confirm()\n- popup()\n- openWin()\n\n##\n\n`<script type=\"text/javascript\" src=\"${basePath}/resources/common/js/base-modal.js\"></script>`\n###1.\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-info\' data-btn-type=\'info\' onclick=\'modals.info(\"\")\'></button>\n</div>\n\n```\n<button class=\'btn btn-info\' data-btn-type=\'info\' onclick=\'info()\'></button>\n\n<script>\n  function info(){\n     modals.info(\'\');\n  }\n</script>\n```\n###2.\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-success\' data-btn-type=\'success\' onclick=\'modals.correct(\"\")\'></button>\n</div>\n\n```\n<button class=\'btn btn-success\' data-btn-type=\'success\' onclick=\'correct()\'></button>\n\n<script>\n  function correct(){\n     modals.correct(\'\');\n  }\n</script>\n```\n###3.\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-warning\' data-btn-type=\'warn\' onclick=\'modals.warn(\"\")\'></button>\n</div>\n\n```\n<button class=\'btn btn-warning\' data-btn-type=\'warn\' onclick=\'warn()\'></button>\n\n<script>\n  function warn(){\n     modals.warn(\'\');\n  }\n</script>\n```\n###4.\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-danger\' data-btn-type=\'error\' onclick=\'modals.error(\"\")\'></button>\n</div>\n\n```\n<button class=\'btn btn-danger\' data-btn-type=\'error\' onclick=\'error()\'></button>\n\n<script>\n  function error(){\n     modals.error(\'\');\n  }\n</script>\n```\n###5.\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-primary\' data-btn-type=\'confirm\' onclick=\'modals.confirm(\"\",function(){alert(\"do something\")})\'></button>\n</div>\n\n```\n<button class=\'btn btn-primary\' data-btn-type=\'confirm\' onclick=\'confirm()\'></button>\n\n<script>\n  function confirm(){\n     modals.confirm(\'\'function(){\n	    alert(\'do something\');\n	 });\n  }\n</script>\n```\n\"\"\n```javascript\n modals.confirm({\n                text:\"\"+userArr.length+\"\",\n                callback:function () {\n                    openGroupAddWin();\n                    modals.hideWin(\"receiverWin\");\n                },\n                cancel_call:function () {\n                    setReceiverUserIds();\n                    modals.hideWin(\"receiverWin\");\n                }\n        })\n```\n###6.\n<div style=\"padding-bottom:20px;\">\n<button class=\'btn btn-info\' data-btn-type=\'window\' onclick=\'modals.openWin({winId:\"userWin\", title:\"\", width:\"900px\", url:basePath+\"/user/edit\"})\'></button>\n</div>\n\n```\n<button class=\'btn btn-info\' data-btn-type=\'window\' onclick=\'openWin()\'></button>\n\n<script>\n  function openWin(){\n     modals.openWin({\n	    winId:\'userWin\',\n        title:\'\',\n        width:\'900px\',\n        url:basePath+\"/user/edit\"\n	 });\n  }\n</script>\n```\n\n <button class=\"btn btn-primary\" id=\"btn_msg\" style=\"width: 100%\" onclick=\'modals.openWin({ \n                winId:\"messageWin\",\n                title:\"billJiang\",\n                width:\"750px\",\n                url:basePath+\"/message/mail/edit\"\n            });\'><i class=\"fa fa-commenting\"></i>&nbsp;&nbsp;billJiang////</button>\n', 'modal', null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('8a8a826c5ac5e9a4015ac65cc9630000', '2017-03-13 14:30:54', '0', '2017-03-13 15:03:48', '1', 'CSRF,AdminEAP', 'AdminEAPCSRF', '402880e456223e8f015625231d8e0003', '##\n\nCSRFCross-site request forgeryOne Click AttackSession RidingCSRFXSRFXSSXSSXSSCSRFXSSCSRFXSS\n\nAdminEAPCSRF\n\n##\n\n\n\n1tokensession\n\n2formtokentoken\n\n3tokensessiontoken\n\n4token\n\n##\n1Spring MVC\n```xml\n<mvc:interceptors>\n	    <!-- csrf -->\n		<mvc:interceptor>\n			<!--  -->\n			<mvc:mapping path=\"/**\" />\n			<!--  -->\n			<mvc:exclude-mapping path=\"/resources/**\" />\n			<mvc:exclude-mapping path=\"/uploadPath/**\" />\n			<!-- <mvc:exclude-mapping path=\"/user/user_login\" />\n			<mvc:exclude-mapping path=\"/user/login\" /> -->\n			<bean class=\"com.cnpc.framework.interceptor.CSRFInterceptor\" />\n		</mvc:interceptor>\n	</mvc:interceptors>\n```\n2(CSRFInterceptor.java)\n\n1CSRFcsrftoken\n>preHandlerverifyCSRFTokenGET@ResponseBodysessioncsrftoken,ajaxsessioncsrftokencsrftokenresponseBody,$.ajaxsuccess(successtoken)\n\n```javascript\n$.ajax({\n		type : \'post\',\n		async : false,\n		url : url,\n		data : params,\n		dataType : \'json\',\n		headers:headers,\n		success : function(data, status) {\n			result = data;\n			if(data&&data.code&&data.code==\'101\'){\n				modals.error(\"\"+data.message);\n				return false;\n			}\n			if (callback) { \n				callback.call(this, data, status);\n			}\n		},\n		error : function(err, err1, err2) {\n			console.log(err.responseText);\n		    if(err && err.readyState && err.readyState == \'4\'){\n                var responseBody = err.responseText;\n                if(responseBody){   \n                	 responseBody = \"{\'retData\':\"+responseBody;\n                     var resJson = eval(\'(\' + responseBody + \')\');\n                     $(\"#csrftoken\").val(resJson.csrf.CSRFToken);\n                     this.success(resJson.retData, 200);\n                }\n                return ;\n            } 		    \n			modals.error({\n				text : JSON.stringify(err) + \'<br/>err1:\' + JSON.stringify(err1) + \'<br/>err2:\' + JSON.stringify(err2),\n				large : true\n			});\n		}\n	});\n```\n2CSRFpostHandlercsrftoken\n>RefreshCSRFTokensessioncsrftokenVerifyCSRFTokencsrftoken()ajaxPosterrorcsrftoken\n\n##\ncsrftoken,\n`CSRF ERROR:tokentoken`\n```java \n    @RefreshCSRFToken\n    @RequestMapping(method = RequestMethod.GET, value = \"/edit\")\n    private String edit(String id, HttpServletRequest request) {\n\n        request.setAttribute(\"id\", id);\n        return \"base/user/user_edit\";\n    }\n\n    @VerifyCSRFToken\n    @RequestMapping(method = RequestMethod.POST, value = \"/save\")\n    @ResponseBody\n    private Result saveUser(User user, HttpServletRequest request) {\n        if (StrUtil.isEmpty(user.getId())) {\n            String userId = userService.save(user).toString();\n            //\n            userService.updateUserAvatar(user, request.getRealPath(\"/\"));\n        } else {\n            user.setUpdateDateTime(new Date());\n            userService.update(user);\n        }\n        return new Result(true);\n    }\n\n```\n', 'csrf', null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('8a8a826c5ac5e9a4015ac67d02e00001', '2017-03-13 15:06:05', '0', '2017-03-13 15:58:37', '2', 'render,fnRender,tooltip', 'AdminEAPrender', '402880e456223e8f015625231d8e0003', '##\nAdminEAPBootstrap-DataTablesJquery-DataTables,AdminEAP\n- render type=eq \'\'\n- render (type=window) \n- render (type=link)  \n- tooltip \n- fnRender \n\n##xml\nxml\n```xml\n <query id=\"message_draft\" key=\"id\" tableName=\"\" className=\"com.cnpc.tool.message.entity.Message\" widthType=\"px\">\n        <column key=\"rowIndex\" header=\"\" width=\"80\"/>\n        <column key=\"id\" header=\"id\" hidden=\"true\"/>\n        <column key=\"sendUser\" header=\"\" hidden=\"true\" classType=\"String\" allowSort=\"false\" width=\"150\"/>\n        <!--enableTootip() maxLen(10dataTables.js) tooltiptooltip -->\n        <!--render=\"type=window\";modals.openWin-->\n        <!--<column key=\"sendSubject\" header=\"\" classType=\"String\" align=\"left\" render=\"type=window,winId=messageEditWin,url=/message/edit?id=[id],title=[sendSubject]\" enableTooltip=\"true\" maxLen=\"20\" allowSort=\"true\" width=\"150\"/>-->\n        <!-- render=\"type=link\",methodparams,;paramsrowId-->\n        <!--<column key=\"sendSubject\" header=\"\" classType=\"String\" align=\"left\" render=\"type=link,method=loadPage,params=\'/message/edit?id=[id]\';\'#contentBody\'\" enableTooltip=\"true\" maxLen=\"20\" allowSort=\"true\" width=\"150\"/>-->\n        <column key=\"sendSubject\" header=\"\" classType=\"String\" align=\"left\" render=\"type=link,method=showDetail\" enableTooltip=\"true\" maxLen=\"20\" allowSort=\"true\" width=\"150\"/>    \n        <column key=\"sendTime\" header=\"\" classType=\"Date\" allowSort=\"true\" dateFormat=\"yyyy-mm-dd hh:ii\"  operator=\"between\" width=\"150\"/>\n        <column key=\"messageType\" header=\"\" classType=\"String\" align=\"left\" width=\"50\" fnRender=\"fnRenderMessageType\"/>\n        <!--isServerCondition=true value=0type=hidden-->\n        <column key=\"messageStatus\" header=\"\" isServerCondition=\"true\" value=\"0\" classType=\"String\" allowSort=\"false\" width=\"50\" fnRender=\"fnRenderMessageStatus\"/>\n        <column key=\"messageFlag\" header=\"\" classType=\"String\" allowSort=\"true\" width=\"150\" fnRender=\"fnRenderMessageFlag\"/>\n        <column key=\"fileIds\" header=\"\" classType=\"String\" width=\"150\" fnRender=\"fnRenderFileIds\"/>     \n		  <!--<column key=\"deleted\" header=\"\" classType=\"String\" allowSort=\"true\" width=\"150\" render=\"0=,1=\"/>-->\n    </query>\n```\n\n## \n\n### render(type=eq) \n\n(1) render=\"type=eq,0=1=\" (type=eq)\n(2) render=\"1=,else=\"\n\n\n`type=eq` eqrender,\n\n### render(type=window)\nmodals.openWin\n\n(1) render=\"type=window,winId=messageEditWin,url=/message/edit?id=[id],title=[sendSubject]\n\n[id][sendSubject]column key=\'id\'column key=\'sendSubject\'\n\n`type=window`:render,\n`winId`:id,\n`url`:url,\n\nmodals.openWinwidth\n\n###render(type=link)\nonclick\n\n(1) render=\"type=link,method=loadPage,params=\'/message/edit?id=[id]\';\'#contentBody\'\"\n(2) render=\"type=link,method=showDetail\"\n\n[id]column key=\'id\'\n\n`type=link`:render,\n`method`:\n`params`(`;`),`id`query key\n\n``jsloadPage(url)shoWDetail(rowId)\n\n###fnRender\n\n\n1fnRender=\"fnRenderMessageStatus\"\n\n\n```\nfunction fnRenderMessageStatus(value, type, rowObjoSetting) {\n    if (value == 0) {\n        return \'<span class=\"label label-warning\"></span>\'\n    } else if (value == 4) {\n        return \'<span class=\"label label-success\"></span>\';\n    }\n    return value;\n}\n```\nfnRenderJquery-DataTables\n\n`value`: \n`type`:display\n`rowObj`:rowObj.name\n`oSetting`:\n\n###tooltip\n\n\n\n1enableTooltip=\"true\" maxLen=\"20\" tooltip=\"id\"\n` render=\"type=tooltip,maxLen=20,tooltip=[id]\"`\n\n`enableTooltip`:falsetrue\n`maxLen`:20\n`tooltip`:\n\n\n\n\n\n\n\n\n\n\n      ', 'render', null, null, null, null);
INSERT INTO `tbl_markdown` VALUES ('8a8a83295a8300ff015a839845890000', '2017-02-28 15:21:19', '0', '2017-02-28 15:21:19', '0', 'quartz,,', 'Quartz', '402880e456223e8f015625231d8e0003', 'AdminEAPQuartz\n\nquartztriggerjobjobtriggertriggerCronTriggerSimpleTriggerCronTriggerCronSimpleTrigger\n\nquartz\n\nquartzAdminEAP\n\n-  [ Spring++Quartz1 ](http://blog.csdn.net/jrn1012/article/details/45582985)\n- [ Spring++Quartz2quartz2.2.1oracle ](http://blog.csdn.net/jrn1012/article/details/45583731)\n- [ Spring++Quartz3 ](http://blog.csdn.net/jrn1012/article/details/45583801)\n\n\n\n![](http://img.blog.csdn.net/20170228145717110?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\n##\n\nAdminEAPmysqlmysqlquartz\n###1mysql\n\n```\n    --  \n    -- A hint submitted by a user: Oracle DB MUST be created as \"shared\" and the   \n    -- job_queue_processes parameter  must be greater than 2  \n    -- However, these settings are pretty much standard after any  \n    -- Oracle install, so most users need not worry about this.  \n    --  \n    -- Many other users (including the primary author of Quartz) have had success  \n    -- runing in dedicated mode, so only consider the above as a hint ;-)  \n    --  \n      \n    delete from qrtz_fired_triggers;  \n    delete from qrtz_simple_triggers;  \n    delete from qrtz_simprop_triggers;  \n    delete from qrtz_cron_triggers;  \n    delete from qrtz_blob_triggers;  \n    delete from qrtz_triggers;  \n    delete from qrtz_job_details;  \n    delete from qrtz_calendars;  \n    delete from qrtz_paused_trigger_grps;  \n    delete from qrtz_locks;  \n    delete from qrtz_scheduler_state;  \n      \n    drop table qrtz_calendars;  \n    drop table qrtz_fired_triggers;  \n    drop table qrtz_blob_triggers;  \n    drop table qrtz_cron_triggers;  \n    drop table qrtz_simple_triggers;  \n    drop table qrtz_simprop_triggers;  \n    drop table qrtz_triggers;  \n    drop table qrtz_job_details;  \n    drop table qrtz_paused_trigger_grps;  \n    drop table qrtz_locks;  \n    drop table qrtz_scheduler_state;  \n      \n    --  Job   \n    CREATE TABLE qrtz_job_details  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        JOB_NAME  VARCHAR2(200) NOT NULL,  \n        JOB_GROUP VARCHAR2(200) NOT NULL,  \n        DESCRIPTION VARCHAR2(250) NULL,  \n        JOB_CLASS_NAME   VARCHAR2(250) NOT NULL,   \n        IS_DURABLE VARCHAR2(1) NOT NULL,  \n        IS_NONCONCURRENT VARCHAR2(1) NOT NULL,  \n        IS_UPDATE_DATA VARCHAR2(1) NOT NULL,  \n        REQUESTS_RECOVERY VARCHAR2(1) NOT NULL,  \n        JOB_DATA BLOB NULL,  \n        CONSTRAINT QRTZ_JOB_DETAILS_PK PRIMARY KEY (SCHED_NAME,JOB_NAME,JOB_GROUP)  \n    );  \n    --   Trigger   \n    CREATE TABLE qrtz_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        JOB_NAME  VARCHAR2(200) NOT NULL,   \n        JOB_GROUP VARCHAR2(200) NOT NULL,  \n        DESCRIPTION VARCHAR2(250) NULL,  \n        NEXT_FIRE_TIME NUMBER(13) NULL,  \n        PREV_FIRE_TIME NUMBER(13) NULL,  \n        PRIORITY NUMBER(13) NULL,  \n        TRIGGER_STATE VARCHAR2(16) NOT NULL,  \n        TRIGGER_TYPE VARCHAR2(8) NOT NULL,  \n        START_TIME NUMBER(13) NOT NULL,  \n        END_TIME NUMBER(13) NULL,  \n        CALENDAR_NAME VARCHAR2(200) NULL,  \n        MISFIRE_INSTR NUMBER(2) NULL,  \n        JOB_DATA BLOB NULL,  \n        CONSTRAINT QRTZ_TRIGGERS_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_TRIGGER_TO_JOBS_FK FOREIGN KEY (SCHED_NAME,JOB_NAME,JOB_GROUP)   \n          REFERENCES QRTZ_JOB_DETAILS(SCHED_NAME,JOB_NAME,JOB_GROUP)   \n    );  \n    --  Trigger  \n    CREATE TABLE qrtz_simple_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        REPEAT_COUNT NUMBER(7) NOT NULL,  \n        REPEAT_INTERVAL NUMBER(12) NOT NULL,  \n        TIMES_TRIGGERED NUMBER(10) NOT NULL,  \n        CONSTRAINT QRTZ_SIMPLE_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_SIMPLE_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n        REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    --  Cron Trigger Cron   \n    CREATE TABLE qrtz_cron_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        CRON_EXPRESSION VARCHAR2(120) NOT NULL,  \n        TIME_ZONE_ID VARCHAR2(80),  \n        CONSTRAINT QRTZ_CRON_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_CRON_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n          REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    CREATE TABLE qrtz_simprop_triggers  \n      (            \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        STR_PROP_1 VARCHAR2(512) NULL,  \n        STR_PROP_2 VARCHAR2(512) NULL,  \n        STR_PROP_3 VARCHAR2(512) NULL,  \n        INT_PROP_1 NUMBER(10) NULL,  \n        INT_PROP_2 NUMBER(10) NULL,  \n        LONG_PROP_1 NUMBER(13) NULL,  \n        LONG_PROP_2 NUMBER(13) NULL,  \n        DEC_PROP_1 NUMERIC(13,4) NULL,  \n        DEC_PROP_2 NUMERIC(13,4) NULL,  \n        BOOL_PROP_1 VARCHAR2(1) NULL,  \n        BOOL_PROP_2 VARCHAR2(1) NULL,  \n        CONSTRAINT QRTZ_SIMPROP_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_SIMPROP_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n          REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    -- Trigger  Blob ( Quartz  JDBC  Trigger <span style=\"color:#800080;\">JobStore</span> )  \n    CREATE TABLE qrtz_blob_triggers  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        BLOB_DATA BLOB NULL,  \n        CONSTRAINT QRTZ_BLOB_TRIG_PK PRIMARY KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP),  \n        CONSTRAINT QRTZ_BLOB_TRIG_TO_TRIG_FK FOREIGN KEY (SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)   \n            REFERENCES QRTZ_TRIGGERS(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP)  \n    );  \n    --  Blob  Quartz  Calendar   \n    CREATE TABLE qrtz_calendars  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        CALENDAR_NAME  VARCHAR2(200) NOT NULL,   \n        CALENDAR BLOB NOT NULL,  \n        CONSTRAINT QRTZ_CALENDARS_PK PRIMARY KEY (SCHED_NAME,CALENDAR_NAME)  \n    );  \n    --  Trigger    \n    CREATE TABLE qrtz_paused_trigger_grps  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        TRIGGER_GROUP  VARCHAR2(200) NOT NULL,   \n        CONSTRAINT QRTZ_PAUSED_TRIG_GRPS_PK PRIMARY KEY (SCHED_NAME,TRIGGER_GROUP)  \n    );  \n    --  Trigger  Job   \n    CREATE TABLE qrtz_fired_triggers   \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        ENTRY_ID VARCHAR2(95) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        INSTANCE_NAME VARCHAR2(200) NOT NULL,  \n        FIRED_TIME NUMBER(13) NOT NULL,  \n        PRIORITY NUMBER(13) NOT NULL,  \n        STATE VARCHAR2(16) NOT NULL,  \n        JOB_NAME VARCHAR2(200) NULL,  \n        JOB_GROUP VARCHAR2(200) NULL,  \n        IS_NONCONCURRENT VARCHAR2(1) NULL,  \n        REQUESTS_RECOVERY VARCHAR2(1) NULL,  \n        CONSTRAINT QRTZ_FIRED_TRIGGER_PK PRIMARY KEY (SCHED_NAME,ENTRY_ID)  \n    );  \n    --  Scheduler  Scheduler ()  \n    CREATE TABLE qrtz_scheduler_state   \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        INSTANCE_NAME VARCHAR2(200) NOT NULL,  \n        LAST_CHECKIN_TIME NUMBER(13) NOT NULL,  \n        CHECKIN_INTERVAL NUMBER(13) NOT NULL,  \n        CONSTRAINT QRTZ_SCHEDULER_STATE_PK PRIMARY KEY (SCHED_NAME,INSTANCE_NAME)  \n    );  \n    -- ()  \n    CREATE TABLE qrtz_locks  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        LOCK_NAME  VARCHAR2(40) NOT NULL,   \n        CONSTRAINT QRTZ_LOCKS_PK PRIMARY KEY (SCHED_NAME,LOCK_NAME)  \n    );  \n      \n    create index idx_qrtz_j_req_recovery on qrtz_job_details(SCHED_NAME,REQUESTS_RECOVERY);  \n    create index idx_qrtz_j_grp on qrtz_job_details(SCHED_NAME,JOB_GROUP);  \n      \n    create index idx_qrtz_t_j on qrtz_triggers(SCHED_NAME,JOB_NAME,JOB_GROUP);  \n    create index idx_qrtz_t_jg on qrtz_triggers(SCHED_NAME,JOB_GROUP);  \n    create index idx_qrtz_t_c on qrtz_triggers(SCHED_NAME,CALENDAR_NAME);  \n    create index idx_qrtz_t_g on qrtz_triggers(SCHED_NAME,TRIGGER_GROUP);  \n    create index idx_qrtz_t_state on qrtz_triggers(SCHED_NAME,TRIGGER_STATE);  \n    create index idx_qrtz_t_n_state on qrtz_triggers(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP,TRIGGER_STATE);  \n    create index idx_qrtz_t_n_g_state on qrtz_triggers(SCHED_NAME,TRIGGER_GROUP,TRIGGER_STATE);  \n    create index idx_qrtz_t_next_fire_time on qrtz_triggers(SCHED_NAME,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_st on qrtz_triggers(SCHED_NAME,TRIGGER_STATE,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_misfire on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_st_misfire on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME,TRIGGER_STATE);  \n    create index idx_qrtz_t_nft_st_misfire_grp on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME,TRIGGER_GROUP,TRIGGER_STATE);  \n      \n    create index idx_qrtz_ft_trig_inst_name on qrtz_fired_triggers(SCHED_NAME,INSTANCE_NAME);  \n    create index idx_qrtz_ft_inst_job_req_rcvry on qrtz_fired_triggers(SCHED_NAME,INSTANCE_NAME,REQUESTS_RECOVERY);  \n    create index idx_qrtz_ft_j_g on qrtz_fired_triggers(SCHED_NAME,JOB_NAME,JOB_GROUP);  \n    create index idx_qrtz_ft_jg on qrtz_fired_triggers(SCHED_NAME,JOB_GROUP);  \n    create index idx_qrtz_ft_t_g on qrtz_fired_triggers(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP);  \n    create index idx_qrtz_ft_tg on qrtz_fired_triggers(SCHED_NAME,TRIGGER_GROUP);  \n```\n###2SimpleTrigger\n![SimpleTrigger](http://img.blog.csdn.net/20170228145913674?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nSimpleTriggerCronrepeatCountrepeatInterval\n\n###3CronTrigger\n![CronTrigger](http://img.blog.csdn.net/20170228150302971?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nCronTriggerCronCron\n\n###4\nrescheduleJob\n\n```\n     // trigger\n     TriggerBuilder triggerBuilder = trigger.getTriggerBuilder();\n     trigger = setTriggerParam(job, triggerKey, triggerBuilder, trigger);\n     // triggerjob\n     scheduler.rescheduleJob(triggerKey, trigger);\n```\n\n###5\n\"NORMAL\"PAUSE\n\n```java\n      /**\n     * \n     */\n    public void pauseJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.pauseJob(jobKey);\n    }\n\n```\n\n###6\n\"PAUSE\"NORMAL\n\n```\n  /**\n     * \n     */\n    public void resumeJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.resumeJob(jobKey);\n    }\n\n```\n\n###7\n\n\n```\n    /**\n     * \n     */\n    public void deleteJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.deleteJob(jobKey);\n    }\n```\n    \n\n###8\n\n```\n    /**\n     * \n     */\n    public void triggerJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.triggerJob(jobKey);\n    }\n\n```\n\n\n\n\n', 'quartz', null, null, null, null);

