INSERT INTO `tbl_user_item` VALUES ('402880eb5c4c8e52015c4ca01f750005', '2017-05-28 09:16:21', '0', '2017-05-28 09:16:21', '0', null, '1', '402881925c4986bd015c499d23ad0007', '100', 'import java.util.HashMap;\r\nimport java.util.Map;\r\n\r\n/**\r\n * Created by billJiang on 2017/5/27.\r\n * e-mail:475572229@qq.com  qq:475572229\r\n */\r\npublic class Solution005 {\r\n    public int lengthOfLongestSubstring(String s) {\r\n        Map<Character, Integer> map = new HashMap<>();\r\n        int max = 0;\r\n        int start = 0;\r\n        for (int i = 0; i < s.length(); i++) {\r\n            if (map.containsKey(s.charAt(i))) {\r\n                start=Math.max(map.get(s.charAt(i))+1,start);\r\n                if (i - start+1 > max) {\r\n                    max = i - start+1;\r\n                }\r\n\r\n            }else{\r\n                if(i-start+1>max)\r\n                    max=i-start+1;\r\n            }\r\n\r\n            map.put(s.charAt(i), i);\r\n        }\r\n        return max;\r\n    }\r\n}', '402880e456223e8f015625231d8e0003', null, null);
INSERT INTO `tbl_user_item` VALUES ('402880eb5c4d796c015c4d80aecf0000', '2017-05-28 13:21:38', '0', '2017-05-28 13:21:38', '0', null, '1', '402881925c4986bd015c499d23ad0007', '100', 'import java.util.HashMap;\r\nimport java.util.Map;\r\n\r\n/**\r\n * Created by billJiang on 2017/5/27.\r\n * e-mail:475572229@qq.com  qq:475572229\r\n */\r\npublic class Solution005 {\r\n    public int lengthOfLongestSubstring(String s) {\r\n        Map<Character, Integer> map = new HashMap<>();\r\n        int max = 0;\r\n        int start = 0;\r\n        for (int i = 0; i < s.length(); i++) {\r\n            if (map.containsKey(s.charAt(i))) {\r\n                start=Math.max(map.get(s.charAt(i))+1,start);\r\n                if (i - start+1 > max) {\r\n                    max = i - start+1;\r\n                }\r\n\r\n            }else{\r\n                if(i-start+1>max)\r\n                    max=i-start+1;\r\n            }\r\n\r\n            map.put(s.charAt(i), i);\r\n        }\r\n        return max;\r\n    }\r\n}', '402880e456223e8f015625231d8e0003', null, null);
INSERT INTO `tbl_user_item` VALUES ('402880eb5c5f10af015c5f1291290000', '2017-05-31 23:14:31', '0', '2017-05-31 23:14:31', '0', null, '1', '402880e55c597d0c015c59a856730000', '100', '\n/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode head=null;\n        ListNode current=null;\n        \n        ListNode nextNode=l1;\n        int pre=0;\n        while(nextNode!=null){\n            if(head==null){\n               head=new ListNode((l1.val+l2.val)%10+pre);\n               current=head;\n            }\n            else{\n                ListNode node=new ListNode((l1.val+l2.val)%10+pre);\n                current.next=node;\n                current=node;\n            }\n            if(current.val>=10) {\n                pre=current.val/10;\n                current.val=current.val%10;\n            }else {\n                pre = (l1.val + l2.val) / 10;\n            }\n            l1=l1.next;\n            l2=l2.next;\n            if(l1==null&&l2!=null){\n               nextNode=l2;\n               l1=new ListNode(0);\n            }\n            if(l2==null&&l1!=null){\n                nextNode=l1;\n                l2=new ListNode(0);\n            }\n            if(l1==null&&l2==null){\n                nextNode=null;\n            }\n        }\n        if(pre>0){\n            current.next=new ListNode(pre);\n        }\n       return head;\n    }\n}', '402880e456223e8f015625231d8e0003', null, null);
