INSERT INTO `tbl_user_item` VALUES ('8a8a82695c5df690015c5dfbdb230004', '2017-05-31 18:10:05', '0', '2017-05-31 18:10:05', '0', null, '1', '402880e55c597d0c015c59a856730000', '100', '\n/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode head=null;\n        ListNode current=null;\n        \n        ListNode nextNode=l1;\n        int pre=0;\n        while(nextNode!=null){\n            if(head==null){\n               head=new ListNode((l1.val+l2.val)%10+pre);\n               current=head;\n            }\n            else{\n                ListNode node=new ListNode((l1.val+l2.val)%10+pre);\n                current.next=node;\n                current=node;\n            }\n            if(current.val>=10) {\n                pre=current.val/10;\n                current.val=current.val%10;\n            }else {\n                pre = (l1.val + l2.val) / 10;\n            }\n            l1=l1.next;\n            l2=l2.next;\n            if(l1==null&&l2!=null){\n               nextNode=l2;\n               l1=new ListNode(0);\n            }\n            if(l2==null&&l1!=null){\n                nextNode=l1;\n                l2=new ListNode(0);\n            }\n            if(l1==null&&l2==null){\n                nextNode=null;\n            }\n        }\n        if(pre>0){\n            current.next=new ListNode(pre);\n        }\n       return head;\n    }\n}', '402880e456223e8f015625231d8e0003', null, null);
